-- Insercion de admins    
VALUES (42739764, 1, 1, 1);

VALUES (96079673, 2, 1, 1);

-- Insercion de empleados random
SELECT TOP(18) -- Bajamos a 18 porque ya insertamos 2
    p.dni,
    (ABS(CHECKSUM(NEWID())) % 7) + 3, -- Roles del 3 al 9
    (ABS(CHECKSUM(NEWID())) % 5) + 1, -- Turno random
    1
FROM persona p
WHERE p.dni NOT IN (42739764, 96079673) -- IMPORTANTE! No duplicar a los jefes
  AND p.dni NOT IN (SELECT dni_cliente FROM cliente)
ORDER BY NEWID();
    
--------------------------------------------------
--TABLA cliente
--------------------------------------------------
SELECT TOP(50)
    p.dni AS dni_cliente
FROM
    persona p
WHERE
    p.dni NOT IN (SELECT dni_empleado FROM empleado) -- Excluye los dni en la tabla empleado    
ORDER BY
    p.dni; -- Ordenar por DNI para asegurar la misma seleccin de 50 filas
    
    
