-- =============================================================================
-- SCRIPT DE INSERCIN MASIVA PARA LA TABLA 'reserva' (1,000,000 FILAS)
-- REGLAS: id_rol = 3, id_estado = 1, id_evento entre 1 y 6.
-- =============================================================================
/*
-- Desactiva el conteo de filas para evitar overhead en el servidor.
SET NOCOUNT ON;

-- 1. DECLARACIN DE VARIABLES
DECLARE @CountClientes INT;
DECLARE @CountEmpleadosRol3 INT;

-- Obtener el nmero de clientes para el operador MODULO (50)
SELECT @CountClientes = COUNT(*) FROM dbo.cliente;
-- Obtener el nmero de empleados elegibles (ID_ROL = 3)
SELECT @CountEmpleadosRol3 = COUNT(*) FROM dbo.empleado WHERE id_rol = 3;

-- 2. VALIDACIONES
IF @CountClientes = 0 OR @CountEmpleadosRol3 = 0
BEGIN
    RAISERROR('Error: No se pueden generar reservas sin clientes o sin empleados con ID_ROL = 3.', 16, 1);
    RETURN;
END;
-- 3. GENERACIN E INSERCIN MASIVA USANDO CTES
;WITH
-- CTE A: Generador de Filas. Crea 1 milln de registros secuenciales para el JOIN.
L0 AS (SELECT c FROM (VALUES(1),(1)) AS D(c)), -- 2 filas
L1 AS (SELECT 1 AS c FROM L0 AS A CROSS JOIN L0 AS B), -- 4 filas
L2 AS (SELECT 1 AS c FROM L1 AS A CROSS JOIN L1 AS B), -- 16 filas
L3 AS (SELECT 1 AS c FROM L2 AS A CROSS JOIN L2 AS B), -- 256 filas
L4 AS (SELECT 1 AS c FROM L3 AS A CROSS JOIN L3 AS B), -- 65,536 filas
L5 AS (SELECT 1 AS c FROM L4 AS A CROSS JOIN L4 AS B), -- Suficiente para 1 milln de filas
Generador AS (
    SELECT TOP 1000000 
        ROW_NUMBER() OVER(ORDER BY (SELECT NULL)) AS id -- Genera nmeros del 1 al 1,000,000
    FROM L5
),
-- CTE B: Clientes. Asigna un nmero de orden aleatorio (rn) a cada cliente.
ClientesNumerados AS (
    SELECT 
        dni_cliente,
        ROW_NUMBER() OVER (ORDER BY NEWID()) AS rn
    FROM dbo.cliente
),
-- CTE C: Empleados elegibles. Asigna un nmero de orden aleatorio (rn) a cada empleado con ID_ROL = 3.
EmpleadosNumerados AS (
    SELECT 
        dni_empleado,
        id_rol,
        ROW_NUMBER() OVER (ORDER BY NEWID()) AS rn
    FROM dbo.empleado
    WHERE id_rol = 3 -- Filtro requerido por la regla de negocio
)
-- 4. INSERTAR DATOS GENERADOS
    fecha_reserva,
    cant_personas,
    id_estado, 
    id_evento,
    dni_cliente,
    dni_empleado,
    id_rol
)
SELECT 
    -- FECHA_RESERVA: Genera un DATETIME aleatorio en los ltimos 5 aos (1825 das)
    DATEADD(second, (ABS(CHECKSUM(NEWID())) % 86400), 
        DATEADD(day, - (ABS(CHECKSUM(NEWID())) % 1825), GETDATE())) AS fecha_reserva,
    
    -- CANT_PERSONAS: Aleatorio entre 1 y 10
    (ABS(CHECKSUM(NEWID())) % 10) + 1 AS cant_personas,
    
    -- ID_ESTADO: Fijo en 1 (Requerido por el usuario)
    1 AS id_estado, 
    
    -- ID_EVENTO: Aleatorio entre 1 y 6 (Requerido por el usuario)
    (ABS(CHECKSUM(NEWID())) % 6) + 1 AS id_evento,
    
    -- DNI_CLIENTE: Se selecciona ciclando entre los clientes (JOIN con MODULO)
    cli.dni_cliente,
    
    -- DNI_EMPLEADO: Se selecciona ciclando entre los empleados elegibles
    emp.dni_empleado,
    emp.id_rol -- Siempre ser 3
    
FROM Generador AS g
-- JOIN para distribuir clientes: (1, 51, 101, etc. obtienen el cliente 1)
JOIN ClientesNumerados AS cli 
    ON (g.id % @CountClientes) + 1 = cli.rn
-- JOIN para distribuir empleados elegibles
JOIN EmpleadosNumerados AS emp 
    ON (g.id % @CountEmpleadosRol3) + 1 = emp.rn;
-- Reactivar el conteo de filas
SET NOCOUNT OFF;
PRINT 'Insercin de 1,000,000 de registros completada.';
*/

    
